/*Table structure for table `card_master` */

DROP TABLE IF EXISTS `card_master`;

CREATE TABLE `card_master` (
  `CARD_ID` int(11) NOT NULL AUTO_INCREMENT,
  `CARD_DESC` varchar(100) DEFAULT NULL,
  `CARD_CODE` varchar(5) DEFAULT NULL,
  `CARD_ACTIVE_DAYS` int(11) DEFAULT 0,
  `CARD_ACTIVE_MONTHS` decimal(10,2) DEFAULT NULL,
  `BASIC_FEE` int(11) DEFAULT 0,
  `TAX_FEE` varchar(50) DEFAULT NULL,
  `SERVICE_TYPE` varchar(50) DEFAULT NULL,
  `IS_ACTIVE` varchar(1) DEFAULT NULL,
  `WEB_ACTIVE` enum('Y','N','','') NOT NULL,
  `PROD_CATEGORY_ID` int(11) DEFAULT NULL,
  `NO_OF_SESSION` int(11) DEFAULT NULL,
  `CARD_PREFIX` char(1) DEFAULT NULL,
  `FROM_TIME` int(11) DEFAULT NULL,
  `TO_TIME` int(11) DEFAULT NULL,
  `EXTENSION_DAYS` int(11) DEFAULT NULL,
  `company_id` int(11) DEFAULT NULL,
  `point` int(11) DEFAULT NULL,
  `attendance_consider` varchar(1) DEFAULT NULL,
  `application_limit_days` int(10) DEFAULT NULL,
  `account_id` int(10) DEFAULT NULL,
  `package_card_type` enum('M','C','','') NOT NULL,
  `achievement_id` int(10) NOT NULL,
  `appearance_serial` int(11) DEFAULT NULL,
  `covid_extension_days` int(11) DEFAULT NULL,
  PRIMARY KEY (`CARD_ID`),
  KEY `CARD_CODE` (`CARD_CODE`),
  KEY `CARD_ID` (`CARD_ID`),
  KEY `index_CardDtl` (`CARD_ID`,`CARD_CODE`,`IS_ACTIVE`)
) ENGINE=InnoDB AUTO_INCREMENT=252 DEFAULT CHARSET=utf8;

